import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {title: 'Apply for Passport', price: 150, date: new Date(2023, 1, 24)},
    {title: 'Buy Sneakers', price: 15000, date: new Date(2023, 1, 27)},
    {title: 'Learn Machine Learning', price: 0, date: new Date(2023, 1, 30)},
    {title: 'Freelancing', price: 0, date: new Date(2023, 1, 24)}
  ];

  return (
    <div>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
